@sashacolby highlighting Hawai'i Māhū issues on national/global television. GLADE was the home of Hawai'i's first drag cabaret founded by Queen Mother Brandy Lee in the 1960s. While GLADE is known as the establishment that produced many of Hawai'i's legendary performers (a few of which still perform to this day), it is often overshadowed by the dark memories of the infamous "I Am A Boy" buttons. Transgender and drag performers were required to wear these buttons that were illegally enforced by Honolulu Police officers to "ensure the safety" of male patrons and passerbys.

I am so proud of our sister for not only doing amazing each and every week on @rupaulsdragrace but for also representing Hawai'i by spotlighting our history, trials, and triumphs on a global platform. You are a true embassador of aloha, Sasha. Mahalo nui iā 'oe. Aloha nō! 💕

